(function(){

    'use strict';

    var initMidi, ready = false, readyCallbacks = [];

    sequencer.protectedScope.callInitMethods(); // â†’ defined in open_module.js
    initMidi = sequencer.protectedScope.initMidi; // defined in midi_system.js
    delete sequencer.protectedScope; //seal


    sequencer.ready = function(cb){
        if(ready === true){
            cb();
        }else{
            readyCallbacks.push(cb);
        }
    };


    sequencer.addInstrument({
        name: 'sinewave',
        folder: 'heartbeat',
        autopan: false,
        attack: 200,
        keyrange: [21,108],
        release_duration: 50
    });


    sequencer.addInstrument({
        name: 'metronome',
        folder: 'heartbeat',
        //release_duration: 250,
        sample_path: 'heartbeat/metronome',
        keyrange: [60,61],
        mapping: {
            '60': {n: 'lowtick'},
            '61': {n: 'hightick'}
        }
    });

    //console.log(sequencer.os, sequencer.browser);

    //if(sequencer.os === 'ios' || (sequencer.os === 'osx' && sequencer.browser === 'safari')){
    if(sequencer.browser === 'safari'){
        // safari supports only mp3
        sequencer.addSamplePack({
            name: 'metronome',
            folder: 'heartbeat',
            mapping: {
                'hightick': '',
                'lowtick': ''
            }
        });
    }else{
        // ogg
        sequencer.addSamplePack({
            name: 'metronome',
            folder: 'heartbeat',
            mapping: {
                'hightick': '',
                'lowtick': ''
            }
        });
    }


/*


    sequencer.addSamplePack({
        name: 'metronome2',
        folder: 'heartbeat',
        mapping: {
            'hightick': '',
            'lowtick': ''
        }
    });
*/

    //console.log(initMidi);

    sequencer.addTask({
        type: 'init midi',
        method: initMidi,
        params: []
    }, function(){
        readyCallbacks.forEach(function(cb){
            cb();
        });
        if(sequencer.debug >= 4){
            console.log('sequencer ready');
        }
        ready = true;
    }, true);

    sequencer.startTaskQueue();

}());